name ENDS
.code
MAIN PROC FAR
	                      mov      ax,  @data
	                      mov      ds, ax

	               
	mainMenuLoop:         
	                      mov      ax, graphicsMode         	; enter graphicsMode
	                      mov      bx, 0100h                	; BX = 81FFh
	                      int      10h
	
	                      call     drawLogo
	                      call     drawGameBtn
	                      call     drawChatBtn
	                      call     drawExitBtn
	                      call     drawArrows

	CheckInMainMenu:      
	                      mov      ah,0                     	;  ah:al = scan code: ASCII code
	                      int      16h

	                      cmp      ah, 48h                  	; up arrow
	                      jne      downArrow
	                      cmp      arrowoffsetY, arrowAtgame
	                      je       CheckInMainMenu
	                      call     eraseArrows
	                      mov      bx, arrowStep
	                      SUB      arrowoffsetY, bx
	                      call     drawArrows
	                      jmp      CheckInMainMenu

	downArrow:            cmp      ah, 50h                  	; down arrow
	                      jne      enterbtn
	                      cmp      arrowoffsetY, arrowAtExit
	                      je       CheckInMainMenu
	                      call     eraseArrows

	                      mov      bx, arrowStep
	                      ADD      arrowoffsetY, bx
	                      call     drawArrows

	                      jmp      CheckInMainMenu

	enterbtn:             cmp      ah, 01ch                 	; enter
	                      jne      CheckInMainMenu          	; added to prevent other buttons from doing enter's action
	                      cmp      arrowoffsetY, arrowAtExit
	                      je       exitProg
	                      cmp      arrowoffsetY, arrowAtChat
	
	                      cmp      arrowoffsetY, arrowAtgame
	                      je       gameLoop
	                      jmp      CheckInMainMenu
	gameLoop:                                               	;NOTE:since we are using words, we will use the value '2' to traverse pixels
	;//////////////////////////////initializations////////////////////////////////////
	                      mov      ax, graphicsMode
	                      mov      bx, 0100h
	                      int      10h
	                      call     Drawship                 	;this subroutine is responsible for drawing the ship using its cooardinates
	;////////////////////////////Interacting with the user////////////////////////////
	CHECK:                mov      ah,1
	                      int      16h
	                      jz       CHECK                    	; check if there is any input
	                      CALL     GENERATE_OFFSET          	; TO GENERATE THE new OFFSET OF THE ship
	;/////////////////////////////////////////////////////////////////////////////////
	                      jmp      gameLoop

	exitProg:             
	                      mov      ah,4ch
	                      int      21h
        

MAIN ENDP
GENERATE_OFFSET PROC near

	                      cmp      al,1Bh                   	; ESC
	                      jz       exitProg
	                      call     Eraseship                	; get the pressed key from the user
	                      MOVEMENT 11H, 1FH, 1EH, 20H


	ReadKey:              
	                      call     Drawship

	                      mov      ah,0                     	;wait for a key to be pressed and put it in ah, ah:al = scan code: ASCII code
	                      int      16h

	                      mov      cx, 0                    	; initialize cx to use it to iterate over the shipSize
	                      jmp      CHECK
	;///////////////////////////////////////////////////////////////////////////////////////
	MoveUp:               
	;checking for boundaries
	;moveUP
	                      mov      bx, shipOffsetY
	                      cmp      bx, screenMinY
	                      jna      ReadKey
	                      sub      bx, planeSpeed
	                      mov      DI, offset shipOffsetY
	                      mov      [DI], bx

	                      jmp      ReadKey

	MoveDown:             
	;checking for boundaries
	;MoveDown
	                      mov      bx, shipOffsetY
	                      mov      cx, bx
	                      add      cx, shipSizeY
	                      cmp      cx, screenMaxY
	                      jnb      ReadKey
	                      add      bx,planeSpeed
	                      mov      DI, offset shipOffsetY
	                      mov      [DI], bx

	                      jmp      ReadKey

	MoveLeft:             
	;checking for boundaries
	                      mov      bx, shipOffsetX
	                      cmp      bx, screenMinX
	                      jna      ReadKey
	                      sub      bx, planeSpeed
	                      mov      DI, offset shipOffsetX
	                      mov      [DI], bx
	          
	                      jmp      ReadKey

	MoveRight:            
	;checking for boundaries
	                      mov      bx, shipOffsetX
	                      mov      cx, bx
	                      add      cx, shipSizeX
	                      cmp      cx, screenMaxX
	                      jnb      ReadKey
	                      add      bx, planeSpeed
	                      mov      DI, offset shipOffsetX
	                      mov      [DI], bx

	                      jmp      ReadKey
	                      ret

GENERATE_OFFSET ENDP

drawGameBtn PROC
	; initialize containers
	                      mov      SI, offset gamebtn
	                      mov      cx, btnsize              	;Column X
	                      mov      dx, btnsize + 2          	;Row Y
	                      mov      ah, 0ch                  	;Draw Pixel Command
	drawGameBtn_drawIt:   
	                      mov      bl, [SI]                 	;use color from array color for testing
	                      and      bl, bl
	                      JZ       drawGameBtn_back
	                      add      cx, gamebtnOffset
	                      add      dx, gamebtnOffset + 2
	                      mov      al, [SI]                 	;  use color from array color for testing
	                      int      10h                      	;  draw the pixel
	                      sub      cx, gamebtnOffset
	                      sub      dx, gamebtnOffset + 2
	drawGameBtn_back:     
	                      inc      SI
	                      DEC      Cx                       	;  loop iteration in x direction
	                      JNZ      drawGameBtn_drawIt       	;  check if we can draw current x and y and excape the y iteration
	                      mov      Cx, btnsize              	;  if loop iteration in y direction, then x should start over so that we sweep the grid
	                      DEC      DX                       	;  loop iteration in y direction
	                      JZ       drawGameBtn_alldrawn     	;  both x and y reached 00 so finish drawing
	                      jmp      drawGameBtn_drawIt
	drawGameBtn_alldrawn: ret
drawGameBtn ENDP
